    lat: 33.455701,
    lng: 126.575667,
    Acongestion: 15,
  },
  {
    id: 5,
    name: "Hospital 5",
    lat: 33.451201,
    lng: 126.568867,
    Acongestion: 20,
  },
  {
    id: 6,
    name: "Hospital 6",
    lat: 33.448701,
    lng: 126.573267,
    Acongestion: 5,
  },
  {
    id: 7,
    name: "Hospital 7",
    lat: 33.453701,
    lng: 126.572267,
    Acongestion: 8,
  },
  {
    id: 8,
    name: "Hospital 8",
    lat: 33.452701,
    lng: 126.574867,
    Acongestion: 2,
  },
  {
    id: 9,
    name: "Hospital 9",
    lat: 33.449701,
    lng: 126.569867,
    Acongestion: 22,
  },
  {
    id: 10,
    name: "Hospital 10",
    lat: 33.454701,
    lng: 126.568267,
    Acongestion: 12,
  },
  {
    id: 11,
    name: "Hospital 11",
    lat: 33.456701,
    lng: 126.576667,
    Acongestion: 3,
  },
  {
    id: 12,
    name: "Hospital 12",
    lat: 33.447701,
    lng: 126.571867,
    Acongestion: 10,
  },
  {
    id: 13,
    name: "Hospital 13",
    lat: 33.458701,
    lng: 126.573867,
    Acongestion: 18,
  },
  {
    id: 14,
    name: "Hospital 14",
    lat: 33.456701,
    lng: 126.578867,
    Acongestion: 21,
  },
  {
    id: 15,
    name: "Hospital 15",
    lat: 33.457701,
    lng: 126.572867,
    Acongestion: 7,
  },
  {
    id: 16,
    name: "Hospital 16",
    lat: 33.451701,
    lng: 126.577867,
    Acongestion: 9,
  },
  {
    id: 17,
    name: "Hospital 17",
    lat: 33.450701,
    lng: 126.574867,
    Acongestion: 19,
  },
  {
    id: 18,
    name: "Hospital 18",
    lat: 33.459701,
    lng: 126.575867,
    Acongestion: 6,
  },
  {
    id: 19,
    name: "Hospital 19",
    lat: 33.455701,
    lng: 126.579867,
    Acongestion: 14,
  },
  {
    id: 20,
    name: "Hospital 20",
    lat: 33.457701,
    lng: 126.576867,
    Acongestion: 23,
  },
  {
    id: 21,
    name: "Hospital 21",
    lat: 33.453701,
    lng: 126.577867,
    Acongestion: 13,
  },
  {
    id: 22,
    name: "Hospital 22",
    lat: 33.452701,
    lng: 126.570867,
    Acongestion: 11,
  },
  {
    id: 23,
    name: "Hospital 23",
    lat: 33.458701,
    lng: 126.572867,
    Acongestion: 4,
  },
];

const MapOrder = () => {
  useEffect(() => {
    // 지도를 표시할 div
    var mapContainer = document.getElementById("map");

    // 지도의 중심좌표와 확대 레벨
    var mapOption = {
      center: new kakao.maps.LatLng(33.450701, 126.570667),
      level: 3,
    };

    // 지도를 생성합니다
    var map = new kakao.maps.Map(mapContainer, mapOption);

    // 병원 데이터를 기반으로 지도에 아이콘을 표시하는 함수
    const displayHospitalsOnMap = (hospitals) => {
      hospitals.forEach((hospital) => {
        const position = new kakao.maps.LatLng(hospital.lat, hospital.lng); // 병원의 위도, 경도

        let iconSrc;
        if (hospital.Acongestion >= 20) {
          iconSrc = redSign;
        } else if (hospital.Acongestion >= 10) {
          iconSrc = orangeSign;
        } else if (hospital.Acongestion >= 5) {
          iconSrc = yellowSign;
        } else if (hospital.Acongestion >= 0) {
          iconSrc = greenSign;
        }

        const imageSize = new kakao.maps.Size(24, 24);
        const imageOption = { offset: new kakao.maps.Point(27, 69) };

        const markerImage = new kakao.maps.MarkerImage(
          iconSrc,
          imageSize,
          imageOption
        );
        const marker = new kakao.maps.Marker({
          position: position,
          image: markerImage,
        });

        marker.setMap(map);
      });
    };

    displayHospitalsOnMap(sampleHospitals);
  }, []);

  return (
    <div
      id="map"
      style={{
        width: "100%",
        height: "500px",
        borderRadius: "10px",
        boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
      }}
    ></div>
  );
};

export default MapOrder;
